import React, { useEffect, useState } from "react";
import IssueList from "../components/IssueList";
import IssueForm from "../components/IssueForm";

const Dashboard = () => {
  const [issues, setIssues] = useState([]);

  // Use dummy issues to test frontend
  useEffect(() => {
    setIssues([
      { _id: "1", title: "Test Issue 1", description: "This is a test issue" },
      { _id: "2", title: "Test Issue 2", description: "Another test issue" },
    ]);
  }, []);

  return (
    <div style={{ padding: "20px" }}>
      <h1>Bug Tracker Dashboard</h1>

      {/* Add Issue Form (won't submit to backend for this test) */}
      <IssueForm onIssueAdded={() => {}} />

      {/* List of Issues */}
      <IssueList issues={issues} />
    </div>
  );
};

export default Dashboard;
